  [],\n\t\"revision_timestamp\": \"2016-04-06T23:20:22.987617\",\n\t\"name\": \"beneficiary-activation-in-the-medicare-population\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>According to findings reported in Beneficiary
  Activation in the Medicare Population, published in Volume 4, Issue 4 of the Medicare
  and Medicaid Research Review, characteristics associated with low patient activation
  in the Medicare population include being Hispanic, widowed or never married, male,
  in poor health, and lacking a usual source of care,  the strongest predictor of
  low activation is having less than a high school degree. While these characteristics
  associated with low activation are similar to those found in other populations,
  this study is one of the first to evaluate patient activation in a nationally representative
  sample of Medicare beneficiaries, using the Patient Activation supplement in the
  2012 Medicare Current Beneficiary Survey Access to Care file. Targeted efforts to
  increase patient activation among Medicare beneficiaries, such as the Blue Button
  initiative, may help improve quality of care and decrease national healthcare costs.</p>n\",\n\t\"license_title\":
